import React from "react";

export default function LoginForm(){

    return(
        <>
        <section className="container-fluid">
            <div className="row">
                <div className="col-5 m-auto">
                    <div className="card">
                        <div className="card-header">
                            <h1>Login form</h1>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    );
}
